import { Component } from "react";

class ListProgress extends Component {
    constructor(props) {
        super(props);

        this.state = {
            progress: [
                { day: 1, description: "Did 30 pushups." },
                { day: 2, description: "Did 31 pushups." },
                { day: 3, description: "Did 32 pushups." },
            ],
        };
    }

    render() {
        return (
            <div>
                <h1>Gym Progress</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Day</th>
                            <th>Description</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{this.state.progress.day}</td>
                            <td>{this.state.progress.description}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default ListProgress;
